import './App.css';

function App() {
    return (
        <div className="App">
            <header id="header">
                <a href="#">Home</a>
                <a href="#">Policy</a>
                <a href="#">Content</a>
            </header>
            <div id="main">
                <p id="time-stamp" onClick="time()"/>
            </div>
            <footer id="footer">Footer</footer>
        </div>
    );
}

function time(){
    document.getElementById("time-stamp").innerHTML = Date.now();
}

export default App;
